var express=require("express");
var app=express();
app.set("view engine","ejs");

app.get("/",function(req, res) {
    res.render("landing");
});

app.get("/campgrounds",function(req, res) {
    var camp=[{name:"Salmon creek",image:"data:image/jpeg;base64,"}
   ,{name:"Monatana",image:"data:image/jpeg;base64,"}
   ,{name:"Ludhiyayana",image:"data:image/jpeg;base64,"}
    ,{name:"Paris",image:"data:image/jpeg;base64,"
    },{name:"Itlay",image:"data:image/jpeg;base64,"}];
    res.render("campgrounds",{data:camp});
});



app.listen(process.env.PORT,process.env.IP,function(req,res){
    console.log("YelpMe App has started");
});